import {createApp} from 'vue'
import store from "@/scripts/store"
import router from "@/scripts/router";
import App from './App.vue'

createApp(App)
  .use(store)
  .use(router)
  .directive('numberWithCommas', function(value) {
    return value.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
  })
  .mount('#app');
